import React, { useState, useEffect } from 'react';
import {
  Typography,
  Button,
  TextField,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
} from '@mui/material';
import axios from 'axios';
import { API_ENDPOINTS } from '../config/api';

function ProductList() {
  const [products, setProducts] = useState([]);
  const [open, setOpen] = useState(false);
  const [newProduct, setNewProduct] = useState({
    product_name: '',
    product_category: '',
    product_price: '',
    product_image: '-',
  });

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await axios.get(API_ENDPOINTS.PRODUCTS);
      setProducts(response.data);
    } catch (error) {
      console.error('Error fetching products:', error);
    }
  };

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleChange = (e) => {
    setNewProduct({
      ...newProduct,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async () => {
    try {
      console.log('Submitting product:', newProduct);
      const response = await axios.post(API_ENDPOINTS.PRODUCTS, newProduct);
      console.log('Response:', response.data);
      fetchProducts();
      handleClose();
      setNewProduct({
        product_name: '',
        product_category: '',
        product_price: '',
        product_image: '-',
      });
    } catch (error) {
      console.error('Error creating product:', error);
      console.error('Error details:', error.response?.data);
    }
  };

  return (
    <div className="ml-64 p-8">
      <div className="max-w-4xl mx-auto">
        <div className="flex justify-between items-center mb-6">
          <Typography variant="h4" className="text-[#88D8C0] font-bold">
            Product
          </Typography>
          <Button
            onClick={handleOpen}
            className="bg-[#4CAF50] text-white hover:bg-[#4CAF50] rounded-full px-6 py-2 normal-case"
          >
            Add Product
          </Button>
        </div>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {products.map((product) => (
            <div
              key={product._id}
              className="bg-white rounded-xl shadow-lg overflow-hidden"
            >
              <img
                src={product.product_image}
                alt={product.product_name}
                className="w-full h-40 object-cover"
              />
              <div className="p-4">
                <Typography variant="h6" className="text-[#88D8C0] font-semibold">
                  {product.product_name}
                </Typography>
                <Typography className="text-gray-500 text-sm">
                  {product.product_category}
                </Typography>
                <Typography className="text-[#88D8C0] font-bold mt-2">
                  Rp {product.product_price}
                </Typography>
              </div>
            </div>
          ))}
        </div>
      </div>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle className="text-[#88D8C0] font-bold">Add New Product</DialogTitle>
        <DialogContent className="space-y-4 p-6">
          <TextField
            autoFocus
            fullWidth
            name="product_name"
            label="Product Name"
            value={newProduct.product_name}
            onChange={handleChange}
            className="bg-gray-50 rounded-lg"
          />
          <TextField
            fullWidth
            name="product_category"
            label="Category"
            value={newProduct.product_category}
            onChange={handleChange}
            className="bg-gray-50 rounded-lg"
          />
          <TextField
            fullWidth
            name="product_price"
            label="Price"
            type="number"
            value={newProduct.product_price}
            onChange={handleChange}
            className="bg-gray-50 rounded-lg"
          />
        </DialogContent>
        <DialogActions className="p-4">
          <Button
            onClick={handleClose}
            className="text-gray-600 hover:text-gray-800 normal-case"
          >
            Cancel
          </Button>
          <Button
            onClick={handleSubmit}
            className="bg-[#4CAF50] text-white hover:bg-[#4CAF50] rounded-full px-6 py-2 normal-case"
          >
            Add Product
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}

export default ProductList;
